      SELECT - + col0 * - 90 AS col2 FROM tab2 (FORMAT parquet) WHERE - col1 IS NULL OR - 38 * 3 * - ( - 21 ) * + 87 + - col0 * col2 + ( - col1 ) + 66 + col0 + + + col0 IS NULL;
  - name: tab2

outputs:
  - name: q3189.out
    data: |
